import './card.css'
import { Link } from "react-router-dom";

export default function PokemonCard(props) {
  return (
    <Link className="caja-carta" to="/detalles"> 
    <div className="caja-carta">
   
      
     
     <img src={props.image} alt={props.name}  width="90"
       height="70" />


      <div className='caja-de-letras'>
      <p><p className='nombres'>Nombre:</p>{props.name}</p>
      <p><p className='nombres'>Tipos:</p>  {props.types}</p>
      </div>
     
      
    </div>
    </Link>

  )
}
